import styled from 'styled-components'

const Success = () => {
    const Container = styled.div`
        height: 100vh;
          display: flex;
          justify-content: center;
          align-items: center;
    `
       const AmountPaid = styled.div`
       width: fit-content;
        padding: 15px;
        background-color: #000;
        color: #fff;
        border-radius: 8px;
        border: none;

 `
  return (
    <Container>
        <AmountPaid>Amount Paid Succcessfully</AmountPaid>
    </Container>
  )
}

export default Success
